import socket, re, fractions, sys
HOST="misc.chal.csaw.io"; PORT=4324
s=socket.create_connection((HOST, PORT))
welcome=s.recv(4096).decode()
print(welcome)
# Might contain first equation in same buffer.
buffer=welcome
while True:
    if "What does" in buffer:
        # parse last equation line
        lines=buffer.strip().splitlines()
        line=[l for l in lines if "=" in l and "X" in l][-1]
        m=re.search(r'X\s*([+\-*/])\s*(-?\d+)\s*=\s*(-?\d+)', line)
        if not m:
            print("failed to parse")
            sys.exit()
        op=m.group(1); a=int(m.group(2)); b=int(m.group(3))
        if op=='+': x=fractions.Fraction(b-a,1)
        elif op=='-': x=fractions.Fraction(b+a,1)
        elif op=='*': x=fractions.Fraction(b, a)
        elif op=='/': x=fractions.Fraction(b*a,1)
        ans = f"{x.numerator}/{x.denominator}" if x.denominator!=1 else str(x.numerator)
        s.sendall((ans+"\n").encode())
    try:
        buffer=s.recv(4096).decode()
        if not buffer:
            break
        print(buffer)
    except Exception as e:
        break
